import React from 'react';
import './App.css';
import PeopleAltIcon from '@material-ui/icons/PeopleAlt';
import Users from './Users';

function App() {
  return (
    <div className="app">
      <div className="header">
        <PeopleAltIcon fontSize="large" className="users-icon" />
      </div>

      <Users />
    </div>
  );
}

export default App;
